(function() {
  var CALLBACK_WEBHOOK, NEWSLETTER_WEBHOOK, zap;

  $('#callback_phone').inputmask("+7 (999) 999-99-99");

  CALLBACK_WEBHOOK = "/callback";

  NEWSLETTER_WEBHOOK = "/newsletter";

  zap = function(data, webhook) {
    data.push({
      name: "created_at",
      value: (new Date()).toString()
    });
    console.log("DATA: ", data);
    $.post(webhook, data);
  };

  $('#callback_form, #newsletter_form').submit(function(e) {
    var data;
    e.preventDefault();
    if ($(this).valid()) {
      data = $(this).serializeArray();
      $(this).hide();
      console.log("this.id: ", this.id);
      if (this.id === "callback_form") {
        zap(data, CALLBACK_WEBHOOK);
        $("#callback_message").removeClass("hidden");
        $(this).delay(1000).queue(function() {
          $('#callback_modal').modal('hide');
          return $(this).dequeue();
        });
      } else {
        zap(data, NEWSLETTER_WEBHOOK);
        $("#newsletter_message").removeClass("hidden");
      }
    }
  });

  $.validator.addMethod("phoneRU", (function(value, element) {
    var regex;
    value = value.replace(/[^\/\d+]/g, '');
    regex = new RegExp(/^((\+7|7|8)+([0-9]){10})$/gm);
    return this.optional(element) || regex.test(value);
  }), "Please enter a valid Russian number.");

  $("#newsletter_form").validate({
    rules: {
      email: {
        required: true,
        email: true
      }
    }
  });

  $("#callback_form").validate({
    rules: {
      phone: {
        required: true,
        phoneRU: true
      }
    }
  });

  $('#callback_modal').on('hidden.bs.modal', function() {
    $('#callback_phone').val("");
    $('#callback_form').removeClass("hidden");
    $('#callback_message').addClass("hidden");
  });

}).call(this);

